// import logo from './logo.svg';
import "./App.css";

const Logo = () => {
  return <h1>LOGOBAKERY</h1>;
};

const Links = () => {
  return (
    <ul>
      <li>Services</li>
      <li>Projects</li>
      <li>About</li>
    </ul>
  );
};

const Button = () => {
  return <button>Contact</button>;
};
function App() {
  return (
    <div>
      <nav className="navbar">
        <Logo></Logo>
        <Links className="navbar-links"></Links>
        <Button></Button>
      </nav>
    </div>
  );
}

export default App;
